import os
import wx
import sys
import base64
import platform
import setproctitle
from io import BytesIO

setproctitle.setproctitle("SoH Mod Organizer")

icon_base64_win = """
            
            """
icon_base64 = """
            
            """
            
# Choose the appropriate icon data based on the platform
if platform.system() == 'Windows':
    icon_data = icon_base64_win
else:
    icon_data = icon_base64

# Decode base64 string to bytes
image_bytes = base64.b64decode(icon_data)

# Create a BytesIO object
image_stream = BytesIO(image_bytes)

# Create a wx.Image object from the stream
image = wx.Image(image_stream, wx.BITMAP_TYPE_ANY)
            
class ModOrganizer(wx.Frame):
    def __init__(self, *args, **kw):
        super(ModOrganizer, self).__init__(*args, **kw)

        self.mods_folder = ""
        self.original_mod_names = []
        self.existing_numbers = []
        self.sorted_mod_names = []
        self.revert = 0
        self.resort2 = 0
        self.duplicate = 0
        self.difference = 0
        self.file_count = 0

        self.init_ui()

    def init_ui(self):
        bitmap = wx.Bitmap(image)
        self.SetIcon(wx.Icon(bitmap))
        self.Center()
        self.Show(True)
        panel = wx.Panel(self)

        vbox = wx.BoxSizer(wx.VERTICAL)

        # Sorting List Section
        self.sort_list = wx.ListBox(panel, style=wx.LB_SINGLE)
        vbox.Add(self.sort_list, proportion=1, flag=wx.EXPAND | wx.ALL, border=10)

        # Buttons Section
        hbox_buttons = wx.BoxSizer(wx.HORIZONTAL)
        sort_btn = wx.Button(panel, label="Sort")
        sort_btn.Bind(wx.EVT_BUTTON, self.on_sort)
        revert_btn = wx.Button(panel, label="Revert Names")
        revert_btn.Bind(wx.EVT_BUTTON, self.on_revert)
        
        # New Refresh Button
        refresh_btn = wx.Button(panel, label="\u27F3")
        refresh_btn.Bind(wx.EVT_BUTTON, self.on_refresh)

        up_btn = wx.Button(panel, label="\u25B2")  # Up arrow
        up_btn.Bind(wx.EVT_BUTTON, self.on_move_up)
        down_btn = wx.Button(panel, label="\u25BC")  # Down arrow
        down_btn.Bind(wx.EVT_BUTTON, self.on_move_down)

        hbox_buttons.Add(up_btn, flag=wx.RIGHT, border=5)
        hbox_buttons.Add(down_btn, flag=wx.RIGHT, border=5)
        hbox_buttons.Add(sort_btn, flag=wx.RIGHT, border=5)
        hbox_buttons.Add(refresh_btn, flag=wx.RIGHT, border=5)
        hbox_buttons.Add(revert_btn, flag=wx.RIGHT, border=5)

        vbox.Add(hbox_buttons, flag=wx.ALIGN_CENTER | wx.ALL, border=10)

        # Path Section
        hbox_path = wx.BoxSizer(wx.HORIZONTAL)
        path_label = wx.StaticText(panel, label="Path:")
        self.path_text = wx.TextCtrl(panel, style=wx.TE_PROCESS_ENTER)
        self.path_text.Bind(wx.EVT_TEXT_ENTER, self.on_path_enter)
        browse_btn = wx.Button(panel, label="Browse")
        browse_btn.Bind(wx.EVT_BUTTON, self.on_browse)

        hbox_path.Add(path_label, flag=wx.ALIGN_CENTER_VERTICAL)
        hbox_path.Add(self.path_text, proportion=1, flag=wx.EXPAND)
        hbox_path.Add(browse_btn)

        vbox.Add(hbox_path, flag=wx.EXPAND | wx.ALL, border=10)

        panel.SetSizer(vbox)

        self.SetSize((800, 600))
        self.SetTitle("SoH Mod Organizer")
        self.Centre()

        # Bind key events for arrow keys
        self.Bind(wx.EVT_CHAR_HOOK, self.on_key_press)

    def on_key_press(self, event):
        keycode = event.GetKeyCode()
        if keycode == wx.WXK_UP:
            self.on_move_up(event)
        elif keycode == wx.WXK_DOWN:
            self.on_move_down(event)
        else:
            event.Skip()

    def on_browse(self, event):
        dlg = wx.DirDialog(self, "Choose a folder:", style=wx.DD_DEFAULT_STYLE)
        if dlg.ShowModal() == wx.ID_OK:
            self.mods_folder = dlg.GetPath()
            self.path_text.SetValue(self.mods_folder)
            self.load_mods()
        dlg.Destroy()

    def load_mods(self):
        self.original_mod_names = self.load_original_names()  # Load original names and indices
        self.refresh_list()

    def load_original_names(self):
        original_names_file = os.path.join(self.mods_folder, "original_names(DONT_DELETE).txt")
        original_mod_names = []
        if os.path.isfile(original_names_file):
            with open(original_names_file, 'r') as file:
                for line in file:
                    line = line.strip()
                    if line:
                        parts = line.split('=')
                        if len(parts) == 2:
                            original_mod_names.append((parts[1].strip(), int(parts[0].strip())))
        return original_mod_names
    
    def load_existing_numbers(self):
        original_names_file = os.path.join(self.mods_folder, "original_names(DONT_DELETE).txt")
        existing_numbers = []
        if os.path.isfile(original_names_file):
            with open(original_names_file, 'r') as file:
                for line in file:
                    line = line.strip()
                    if line:
                        parts = line.split('=')
                        if len(parts) == 2:
                            existing_numbers.append(parts[0].strip())
        return existing_numbers
    
    def has_differences(self):
        print("Mods folder:", self.mods_folder)
        current_file_count = len([file for file in os.listdir(self.mods_folder) if file.lower().endswith(".otr") and os.path.isfile(os.path.join(self.mods_folder, file))])
        print("Ccount:", current_file_count)
        print("Count:", self.file_count)

        if current_file_count != self.file_count:
            self.difference = 1

    def load_listed_mod_names(self):
        listed_mod_names = []

        for i in range(self.sort_list.GetCount()):
            name = self.sort_list.GetString(i)
            listed_mod_names.append((name, i + 1))
        return listed_mod_names
    
    def on_refresh(self, event):
        self.refresh_list()

    def refresh_list(self):
        current_mod_names = [os.path.splitext(file)[0] for file in os.listdir(self.mods_folder) if file.lower().endswith(".otr") and os.path.isfile(os.path.join(self.mods_folder, file))]
        self.file_count = len([file for file in os.listdir(self.mods_folder) if file.lower().endswith(".otr") and os.path.isfile(os.path.join(self.mods_folder, file))])
        print("Count:", self.file_count)
        
        # Clear the list
        self.sort_list.Clear()

        if os.path.isfile(os.path.join(self.mods_folder, "original_names(DONT_DELETE).txt")):
            self.original_mod_names = self.load_original_names()
            self.existing_numbers = self.load_existing_numbers()


            displayed_names = []  # Keep track of displayed names to avoid duplicates

            # Filter out names that have already been sorted
            sorted_names = [name for name, _ in self.original_mod_names if name in displayed_names]

            for mod_name, _ in self.original_mod_names:
                # Display only the original names without the extension
                if mod_name not in displayed_names:
                    self.sort_list.Insert(mod_name, self.sort_list.GetCount())
                    displayed_names.append(mod_name)
                    
            for name in current_mod_names:
                if name not in sorted_names:
                    # Check for duplicates
                    if name in displayed_names:
                        self.sort_list.Insert(f"{name} (DUPLICATE! FIX!!!)", self.sort_list.GetCount())
                        self.duplicate = 1
                    else:
                        # Display new .otr files
                        if name not in displayed_names:
                            self.sort_list.Insert(name, self.sort_list.GetCount())
                            displayed_names.append(name)
                    
            # Remove existing numbered files from sort_list
            for name in self.existing_numbers:
                if name in displayed_names:
                    index = self.sort_list.FindString(name)
                    if index != wx.NOT_FOUND:
                        self.sort_list.Delete(index)
        else:
            # When the text file doesn't exist
            for name in current_mod_names:
                self.sort_list.Insert(name, self.sort_list.GetCount())

    def on_sort(self, event):
        if self.resort2 == 1:
            # Perform the actual sorting
            self.sort()
            self.load_mods()  # Refresh the list after renaming
            self.refresh_list()
            setattr(self, "sorting_in_progress", False)
            self.resort2 == 0
        else:
            if self.mods_folder:  # Check if a folder is loaded
                # Check for duplicate names before sorting
                if self.duplicate == 1:
                    wx.MessageBox("Sort operation cannot proceed due to duplicate names. Fix duplicates before sorting.", "Error", wx.OK | wx.ICON_ERROR)
                    self.duplicate = 0
                    self.refresh_list()
                else:
                    if not getattr(self, "sorting_in_progress", False):  # Check if sorting is already in progress
                        setattr(self, "sorting_in_progress", True)  # Set the flag to indicate sorting is in progress
                        # Check if the original_names file exists
                        original_names_file = os.path.join(self.mods_folder, "original_names(DONT_DELETE).txt")
                        if os.path.isfile(original_names_file):
                            # Resort if the original_names file exists
                            self.resort()
                        else:
                            print("Checking for differences before sorting...")
                            # Check for differences before sorting
                            self.has_differences()
                            print("Differences found:", self.difference)
                            if self.difference == 1:
                                wx.MessageBox("Files in the folder have changed. Please confirm the load order.", "Warning", wx.OK | wx.ICON_WARNING)
                                self.refresh_list()
                                self.difference = 0
                            else:
                                # Perform the actual sorting
                                self.sort()
                        self.load_mods()  # Refresh the list after renaming
                        self.refresh_list()
                        setattr(self, "sorting_in_progress", False)
            else:
                # Show a message or take appropriate action when no folder is loaded
                wx.MessageBox("Please load a folder before sorting.", "Error", wx.OK | wx.ICON_ERROR)

    def on_revert(self, event):
        if self.mods_folder:  # Check if a folder is loaded
            self.revert_files()  # This line calls the function to revert file names
            self.load_mods()  # Refresh the list after reverting
            self.refresh_list()

            # Delete the original_names file after reverting
            original_names_file = os.path.join(self.mods_folder, "original_names(DONT_DELETE).txt")
            if os.path.isfile(original_names_file):
                os.remove(original_names_file)
        else:
            # Show a message or take appropriate action when no folder is loaded
            wx.MessageBox("Please load a folder before reverting names.", "Error", wx.OK | wx.ICON_ERROR)

    def on_move_up(self, event):
        selected_idx = self.sort_list.GetSelection()
        if selected_idx > 0:
            self.swap_items(selected_idx, selected_idx - 1)

    def on_move_down(self, event):
        selected_idx = self.sort_list.GetSelection()
        if selected_idx < self.sort_list.GetCount() - 1:
            self.swap_items(selected_idx, selected_idx + 1)

    def swap_items(self, idx1, idx2):
        item1 = self.sort_list.GetString(idx1)
        item2 = self.sort_list.GetString(idx2)
        self.sort_list.SetString(idx1, item2)
        self.sort_list.SetString(idx2, item1)
        self.sort_list.SetSelection(idx2)

    def save_sort_order(self):
        with open(os.path.join(self.mods_folder, "original_names(DONT_DELETE).txt"), "w") as file:
            for original_name, idx in self.original_mod_names:
                file.write(f"{idx:03}={original_name}\n")


    def on_path_enter(self, event):
        self.mods_folder = self.path_text.GetValue()
        self.load_mods()

    def sort(self):
        mod_names = self.load_listed_mod_names()

        # Rename files based on the new order
        for idx, (original_name, _) in enumerate(mod_names):
            new_path = os.path.join(self.mods_folder, f"{idx + 1:03}.otr")
            old_path = os.path.join(self.mods_folder, f"{original_name}.otr")
            os.rename(old_path, new_path)

        # Save the sort order to a new original_names file
        with open(os.path.join(self.mods_folder, "original_names(DONT_DELETE).txt"), "w") as file:
            for idx, (original_name, _) in enumerate(mod_names):
                file.write(f"{idx + 1:03}={original_name}\n")

        # Update original_mod_names after renaming
        self.original_mod_names = [(original_name, idx + 1) for idx, (original_name, _) in enumerate(mod_names)]

        # Explicitly update the ListBox to reflect the changes
        self.refresh_list()

    def resort(self):
        # Aweful workaround for this function
        self.revert = 1
        self.resort2 = 1

        # Call revert since it doesn't break and make it fork to sort since it also doesn't break
        self.revert_files()

    def revert_files(self):
        for original_name, idx in self.original_mod_names:
            old_path = os.path.join(self.mods_folder, "%03d.otr" % idx)
            new_path = os.path.join(self.mods_folder, original_name + ".otr")
            os.rename(old_path, new_path)
            
            # Delete the original_names file after reverting
            original_names_file = os.path.join(self.mods_folder, "original_names(DONT_DELETE).txt")
            if os.path.isfile(original_names_file):
                os.remove(original_names_file)
                
        #Do this stupidity due to resort breaking everything so we pass it off here
        if self.revert != 1:
            self.load_mods()  # Refresh the list after reverting
            self.refresh_list()
        else:
            self.revert = 0
            self.on_sort(wx.CommandEvent(wx.EVT_BUTTON.typeId))
            
if __name__ == '__main__':
    app = wx.App()
    frame = ModOrganizer(None)
    frame.Show()
    app.MainLoop()